import "./Canvas.scss";

export default class Canvas extends React.Component {

  render() {
    const canvasRef = createRef();
    const ctxRef = createRef();

    componentDidUpdate(
      canvas = canvasRef.current


    )

    return (
      <canvas
        ref={canvasRef}
        className="homepage__canvas"
      ></canvas>
    );
  }
}
